import React from 'react';
import ReactDOM from 'react-dom';

ReactDOM.render(
  <React.Fragment>
    <h1>Ansuman Nayak</h1>,
    <p>please like and share</p>,
    <b>subscribe</b>
  </React.Fragment>
  ,
  document.getElementById("root"));
